import React from 'react';
import './App.css';

import {Alert} from 'reactstrap';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>This is a paragraph.</p>
      </header>
      <div>
        <Alert color="primary">
          This is an alert.
        </Alert>
      </div>
    </div>
  );
}

export default App;
